import{_ as e,c as a,o as r,a2 as t}from"./chunks/framework.Ja7AKUN6.js";const u=JSON.parse('{"title":"2026 年 01 月更新：提案通过，巡查组重启，攻击处理","description":"","frontmatter":{"title":"2026 年 01 月更新：提案通过，巡查组重启，攻击处理","contributors":["Allenyou1126","Xiaozonglin","gtxykn0504"],"date":"2026-01-01T00:00:00.000Z","updated":"2026-01-31T00:00:00.000Z","categories":"博客更新","tags":["公告","巡查工具"]},"headers":[],"relativePath":"blog/202601.md","filePath":"blog/202601.md"}'),o={name:"blog/202601.md"},l=t('<h1 id="_2026-年-01-月更新-提案通过-巡查组重启-攻击处理" tabindex="-1">2026 年 01 月更新：提案通过，巡查组重启，攻击处理 <a class="header-anchor" href="#_2026-年-01-月更新-提案通过-巡查组重启-攻击处理" aria-label="Permalink to &quot;2026 年 01 月更新：提案通过，巡查组重启，攻击处理&quot;">​</a></h1><h2 id="《关于在开往加入规则中增加aigc相关条款的提案》组外投票通过" tabindex="-1">《关于在开往加入规则中增加AIGC相关条款的提案》组外投票通过 <a class="header-anchor" href="#《关于在开往加入规则中增加aigc相关条款的提案》组外投票通过" aria-label="Permalink to &quot;《关于在开往加入规则中增加AIGC相关条款的提案》组外投票通过&quot;">​</a></h2><p>开往维护组在 2025 年 10 月发布了《关于在开往加入规则中增加AIGC相关条款的提案》的组外投票，该投票在 2025 年 12 月 31 日截止。共有 40 人参与本提案的投票，赞成票 33 票，反对票 5 票，保留意见票 2 票，同意票的占比达到 82.5%。该提案获得通过，于本博客发布之日起施行。</p><blockquote><p>您可以在<a href="https://travellings.feishu.cn/share/base/query/shrcn8ZVwudGAcZFWdepSdRzYic" target="_blank" rel="noreferrer">投票结果查询页面</a>以空搜索条件查看所有投票，或在<a href="https://travellings.feishu.cn/share/base/dashboard/shrcnleByQzsmkFSvc7AELhNTsc" target="_blank" rel="noreferrer">投票仪表盘</a>查看统计数据。</p></blockquote><h2 id="开往巡查组的巡查事项说明" tabindex="-1">开往巡查组的巡查事项说明 <a class="header-anchor" href="#开往巡查组的巡查事项说明" aria-label="Permalink to &quot;开往巡查组的巡查事项说明&quot;">​</a></h2><p>开往巡查组的巡查工具现已投入使用。巡查组成员可以联系巡查组负责人添加权限，登录<a href="https://check-tool.travellings.cn" target="_blank" rel="noreferrer">巡查工具</a>参与巡查,负责人也将在近期安排巡查的相关事宜。与此同时，欢迎各位成员加入巡查组。</p><blockquote><p>巡查组加入申请方式：填写<a href="https://travellings.feishu.cn/share/base/form/shrcnbEUAtDKc7aLxesrVO9DaRf" target="_blank" rel="noreferrer">开往 巡查组意愿调查</a></p></blockquote><h2 id="恶意网络攻击处理" tabindex="-1">恶意网络攻击处理 <a class="header-anchor" href="#恶意网络攻击处理" aria-label="Permalink to &quot;恶意网络攻击处理&quot;">​</a></h2><p>近期，开往项目遭遇了一次大规模、持续性的恶意网络攻击。目前，根据蓝易云与 Cloudflare 的监控数据显示，本轮攻击已经结束，相关服务已恢复正常。攻击期间，项目后端服务在蓝易云的安全防护下保持稳定，核心接口未受影响；项目官网原部署于腾讯云 EdgeOne，因遭受高强度攻击被清退，迁移至 Vercel 后再次遭遇封禁，目前已重新部署至 Cloudflare Pages。</p><p>根据防护平台统计，本轮攻击规模巨大：蓝易云累计识别并拦截了近 1 万个恶意 IP 地址，腾讯云 EdgeOne 在攻击期间被刷取约 12TB 异常流量。更为严重的是，2026 年 1 月 27 日晚，攻击者公然在项目 GitHub 仓库发布威胁言论，试图以持续攻击为手段胁迫项目团队满足其无理要求。</p><p>在威胁出现的第一时间，我们已通过国家授时中心认证的可信时间戳对全部威胁证据进行了<a href="https://sharing.tsa.cn/?randomKey=20260127619626634" target="_blank" rel="noreferrer">司法级电子存证</a>，以确保其法律效力。事件发生后，我们迅速整理完整证据材料，并于次日（1 月 28 日）前往公安机关尝试报案，但目前材料尚未被接收。</p><p>我们对攻击者破坏开源公益项目、滥用公共网络资源、公然践踏法律底线的行为予以最强烈的谴责。我们坚信，任何通过违法手段达成目的的企图都不会得逞。感谢所有用户在此期间的理解与耐心，也感谢社区朋友们的持续关注与支持。维护一个干净、开放、友好的网络环境需要大家共同努力，我们将继续坚守初心，依法维护项目与社区的合法权益。</p>',12),n=[l];function s(c,h,i,d,_,p){return r(),a("div",null,n)}const b=e(o,[["render",s]]);export{u as __pageData,b as default};
